import React from 'react';
import SourceData from './Sourcedata.js'
import Card from './Card.js';

const App = () => {
  return (
    <div
      style={{
        margin: '1rem',
        padding: '1.5rem',
        backgroundColor: 'bisque',
        textAlign: 'center'
      }}>
      <div
        style={{
          margin: '1rem',
          padding: '1.5rem',
          backgroundColor: 'bisque',
          textAlign: 'center'
        }}
      >Lists and Libraries</div>
      <Card />
    </div>

  );
}

export default App;
